import Header from './Header';
import TestHeader from '../components/TestHeader';
import Head from 'next/head';
import Footer from '../components/Footer';
import styled from 'styled-components';
import PhotoImage, { path as photoImagePath } from '../assets/sing.png';

const ContainerElement = styled.div`
  background-image: url("${photoImagePath}");
`;

const layoutStyle = {
  margin: -9,
  background: 'black',
  height: '150vh',
  background:
    '#000 url(//images.weserv.nl/?url=i.imgur.com/6QJjYMe.jpg)  center no-repeat',
  backgroundSize: 'cover',
  margin: 0,
};

const Layout = props => (
  <>
    <Head>
      <meta name='viewport' content='width=device-width, initial-scale=1' />
      <meta charSet='utf-8' />
    </Head>
    <style jsx global>{`
      body {
        background: #000;
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }
    `}</style>
    <div style={layoutStyle}>
      <TestHeader />
      {props.children}
      <ContainerElement>
        <PhotoImage alt='flower' />
        <LogoImage width='230' height='140' />
      </ContainerElement>
      <Footer />
    </div>
  </>
);

export default Layout;
